import React from "react";
import styles from "./PanelLogMessage.module.css";

type LogMessageProps = {
    message:string
};

const LogMessage: React.FC<LogMessageProps> = ({message}) => {

    const [myTest, setMyTest] = React.useState<any>();

    React.useEffect(() => {
      const fetchData = async () => {
        const response = await fetch('http://localhost:8080/ship_status');
        const json = await response.json();
        setMyTest(json);
      };

      fetchData(); // Fetch data initially

      const intervalId = setInterval(() => {
        fetchData(); // Fetch data every 2 minutes
      }, 1000);

        console.log("test");

      return () => clearInterval(intervalId);
    }, []);


// <div className={styles.lm_message} >{message}</div>
    return (
        <div className={styles.lm_container} >
            <div>Log Message</div>
            <div className={styles.lm_message} >{myTest.shieldDto.powerConsumption}</div>
        </div>
    );
}

export default LogMessage;
